var twos = new Set()
var threes = new Set()
for (i=0; i<w.riddles.length; i++)
{
    threes.add(w.riddles[i].first)
    threes.add(w.riddles[i].second)
    twos.add(w.riddles[i].first[0] + w.riddles[i].second[0])
    twos.add(w.riddles[i].first[1] + w.riddles[i].second[1])
    twos.add(w.riddles[i].first[2] + w.riddles[i].second[2])
}

function generate_riddle()
{
    var riddle_index = Math.floor(Math.random() * w.riddles.length);
    return w.riddles[riddle_index];
}

function check_answer(first, second)
{
    a = first[0] + second[0]
    b = first[1] + second[1]
    c = first[2] + second[2]

    return threes.has(first) && threes.has(second) && twos.has(a) && twos.has(b) && twos.has(c)
}
